typedef DUNE::Smoothing::Differentiability Differentiability;
typedef DUNE::Smoothing::ReferenceModel ReferenceModel;

void
test_coeffs(Test test, int order, double conv_time, int* coeffs, double* solution, double precision = 1e-4)
{
    Differentiability smoother(conv_time,order);
    std::stringstream ss; 
    for(int i=0; i < (2*order + 1); ++i)
    {
      ss << "Order " << order << " smoother. Coefficient " << i+1 << ":\t" << smoother.getCoeff(i) << "\t" << coeffs[i];
      test.boolean(ss.str().c_str(), (smoother.getCoeff(i) == coeffs[i]));
      ss.str("");//clear ss
    }
    int ti = 0;
    double filtered_vals[order];
    for(double t=0.0; t <=4; t=t+0.5)
    {
      ss << "Order " << order << " smoother. Filtering from 0 to 1, at time " << t << ": \t";// << smoother.filter(0,1,t,filtered_vals) << "\t" << solution[ti];
      test.boolean(ss.str().c_str(), std::fabs(smoother.filter(0,1,t,filtered_vals) - solution[ti++]) < precision);
      ss.str("");//clear ss
    }
}

